import React, { Component } from "react";
import {
  Button,

  Container,
  Form,
  FormGroup,
  Label,
  Input } from 'reactstrap';

import "../App.css"

const StyleBox = {
  paddingLeft: "10%",
  paddingRight: "10%",
  marginTop: "25px",
  marginBottom: "25px",
  position: "relative",
  fontFamily: "Merriweather" ,
  textAlign: "center"
};

class SubscribeBox extends Component {
render() {
 return (
   <div style={StyleBox}>
   <Container>


    <h1> Produk Kami </h1>
    <p> Kamu Tidak Perlu Repot Karena Kami Telah Memilih Snack Terbaik dan Akan Mengirimkan Langsung ke Kamu, Sehingga Kamu Bisa Fokuskan ke Hal Yang Lebih Penting</p>
    <Button
     href="/product"
     color="danger"
     size="lg"> Lihat Produk </Button>


   </Container>
   </div>
  )};
};

export default SubscribeBox;
